export const login = async (email, password) => {
    const response = await fetch('http://localhost/src/backend/php/auth.php', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ email, password }),
    });

    const data = await response.json();
    return data;
  };
